ng_dataset)\n","\n","# Calculating MSE for training and testing data\n","gbm_mse_train <- sqrt(mean((training_dataset$Prod_per_Area - predict_gbm_train)^2))\n","gbm_mse_test <- sqrt(mean((testing_dataset$Prod_per_Area - predict_gbm_test)^2))\n","\n","# Calculating MAE for training and testing data\n","gbm_mae_train <- (sum(abs(training_dataset$Prod_per_Area - predict_gbm_train)) / length(training_dataset$Prod_per_Area))\n","gbm_mae_test <- (sum(abs(testing_dataset$Prod_per_Area - predict_gbm_test)) / length(testing_dataset$Prod_per_Area))\n","\n","\n","# Calculate R-squared for training and testing datasets\n","SSR_gbm_train <- sum((predict_gbm_train - mean(training_dataset$Prod_per_Area))^2)\n","SST_gbm_train <- sum((training_dataset$Prod_per_Area - mean(training_dataset$Prod_per_Area))^2)\n","train_gbm_rsq <- SSR_gbm_train / SST_gbm_train\n","gbm_train_adjrsq <- 1 - ((1 - train_gbm_rsq) * (length(training_dataset$Prod_per_Area) - 1) /\n","                     (length(training_dataset$Prod_per_Area) - 12 - 1))\n","SSR_gbm_test <- sum((predict_gbm_test - mean(testing_dataset$Prod_per_Area))^2)\n","SST_gbm_test <- sum((testing_dataset$Prod_per_Area - mean(testing_dataset$Prod_per_Area))^2)\n","test_gbm_rsq <- SSR_gbm_test / SST_gbm_test\n","gbm_test_adjrsq <- 1 - ((1 - test_gbm_rsq) * (length(testing_dataset$Prod_per_Area) - 1) /\n","                    (length(testing_dataset$Prod_per_Area) - 12 - 1))\n","\n","\n","# Storing results in a data frame\n","gbm_results_df <- data.frame(\n","  Metric = c(\"MSE Training\", \"MSE Testing\", \"MAE Training\", \"MAE Testing\", \"adjR-squared Training\", \"adjR-squared Testing\"),\n","  Value = c(gbm_mse_train, gbm_mse_test, gbm_mae_train, gbm_mae_test, gbm_train_adjrsq, gbm_test_adjrsq)\n",")\n","print(gbm_results_df)"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":4421487,"sourceId":7596116,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":false,"